import Link from 'next/link';

const NAVIGATION = [
    {
        link: '/',
        label: 'Popular'
    },
    {
        link: '/movies',
        label: 'Movies'
    },
    {
        link: '/shows',
        label: 'Shows'
    }
];

const Navbar = () => (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <ul className="navbar-nav mr-auto">
            {NAVIGATION.map((navItem) => <li key={navItem.link} className="nav-item">
                <Link className="nav-link" href={navItem.link}>{navItem.label}</Link>
            </li>)}
        </ul>
        <img src="https://lh3.googleusercontent.com/z61emcjy_0JatoBNeD2xsZswRXXnwvUdPeR2zFka5muBH8v94ljqD18fcxeGjztOEOM" className="rounded float-right" alt="..." height="50" />
        <style jsx>{`
            nav {
                border-radius: 0 0 8px 8px;
                box-shadow: 0px 8px 2px -5px rgba(0,0,0,0.75);
            }
            .navbar {
                position: fixed;
                top: 0;
                left: 0;
                z-index: 9999;
                width: 100%;
            }
        `}
        </style>
    </nav>
)

export default Navbar;
